  "description": "Eric Hugo F. Enhörning was a Swedish consul, born on June 11, 1890 in Björkvik, Södermanland. He was the first-born son of Consul C.F.A.E and H.H.F. Schubert and married Marianne von Rosen in 1918. He had two children, Gunvor and Lars-Erik. Eric Enhörning studied business at the Hanover Institute of Business from 1907-1908, language studies in England from 1911-1912, and earned an agricultural degree from Ultuna Agricultural Institute in 1915. He worked with agriculture and forestry from 1908-1911 before becoming the director and manager of the company P.A. Enhörning & Co in Norrköping from 1917. He became a Lithuanian Consul in 1936. Eric Enhörning was also active in various organizations, such as the Swedish Federation of Trade, Norrköping Commercial Association, and was a member of several yacht clubs, including the Norrköping Yacht Club and Bråviken Sailing Club. His hobbies included sailing, curling, hunting, and fishing."
